import React from "react";

export default function RecipeList(props) {
    const test = () => {
        console.log(props.recipes);
    };
    return (
        <div className="recipe-list">
            <h2>Recipes</h2>
            {props.recipes.map((recipe) => (
                <div className="aRecipe">
                    <h3>{recipe.recipeName}</h3>
                    </div>
            ))}
        </div>
    );
}
